INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (1, 'Fips Code', 'FipsCode', 'Fips Code', 'Character', '', 'FIPS_CODE', 'Federal Information Processing Standards codes used nationally to numerically identify a specific county or political jurisdiction.', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (2, 'Apn Unformatted', 'ApnUnformatted', 'Apn Unformatted', 'Character', '', 'APN_UNFORMATTED', 'Assessor''s Parcel Number in an unformatted form. This is most often used by the county and others as a unique key (e.g.,10132021A)', 'CoreLogic', 'county', 'tax');
