INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (7, 'P Id Iris Frmtd', 'PIdIrisFrmtd', 'P Id Iris Frmtd', 'Character', '', 'P_ID_IRIS_FRMTD', 'APN that would link to FACL online products.', 'CoreLogic', 'county', 'tax');
