INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (9, 'Thomas Bros Map Number', 'ThomasBrosMapNumber', 'Thomas Bros Map Number', 'Character', '', 'THOMAS_BROS_MAP_NUMBER', 'The current map page and grid number used by Thomas Bros. Maps company.', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (10, 'Map Reference 1', 'MapReference1', 'Map Reference 1', 'Character', '', 'MAP_REFERENCE_1', 'A FARES unique key to link record to the FARES CD Map product. This is typically built from components of the APN that are relevant to the Assessor Maps (e.g., 101-32, represent Map Book and Map Page numbers).', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (11, 'Map Reference 2', 'MapReference2', 'Map Reference 2', 'Character', '', 'MAP_REFERENCE_2', 'A secondary FARES unique key to link property records to the FARES CD Map product. See MAP REFERENCE 1 above.', 'CoreLogic', 'county', 'tax');
