INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (14, 'Lot Number', 'LotNumber', 'Lot Number', 'Character', '', 'LOT_NUMBER', 'Subdivision or County Map Lot Number', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (15, 'Range', 'Range', 'Range', 'Character', '', 'RANGE', 'The "range" portion of geographical coordinates based on local surveys. Ranges typically run east or west of pre-determined "meridian" in six mile intervals.', 'CoreLogic', 'county', 'tax');
