INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (19, 'Flood Zone Community Panel Id', 'FloodZoneCommunityPanelId', 'Flood Zone Community Panel Id', 'Character', '', 'FLOOD_ZONE_COMMUNITY_PANEL_ID', 'This represents the FEMA Community Panel Number.', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (20, 'Universal Land Use Code', 'UniversalLandUseCode', 'Universal Land Use Code', 'Character', 'LookupMulti', 'UNIVERSAL_LAND_USE_CODE', 'A FARES established Land Use code converted from various county Land Use codes to aid in search and extract functions. See "LUSE" Table for descriptions', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (21, 'County Land Use 1', 'CountyLandUse1', 'County Land Use 1', 'Character', '', 'COUNTY_LAND_USE_1', 'Primary (i.e., highest) Land Use as established by the county or local taxing administration.', 'CoreLogic', 'county', 'tax');
