INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (26, 'Municipality Name', 'MunicipalityName', 'Municipality Name', 'Character', '', 'MUNICIPALITY_NAME', 'Name of the Municipality where parcel is located.', 'CoreLogic', 'county', 'tax');
INSERT INTO data_source_fields ("MetadataEntryID", "SystemName", "ShortName", "LongName", "DataType", "Interpretation", "LookupName", "Description", data_source_id, data_source_type, data_list_type) VALUES (27, 'Municipality Code', 'MunicipalityCode', 'Municipality Code', 'Character', '', 'MUNICIPALITY_CODE', 'Corresponding Municipality Code (unique within the same county only)', 'CoreLogic', 'county', 'tax');
